import React from 'react';
import {useParams} from 'react-router-dom';
 
const Page=()=>{
    const{child1,child2}=useParams();

    return(
        <>
        <h1>{child1}{child2}</h1>
        <h1>welcome to parent page</h1>

        </>
    );
};

export default Page;
